        [HttpPost]
        public JsonResult GetResultAttachImage(int caseID, int applicantID) 
        {
            ResponseResult res = new ResponseResult();
            try
            {
                //string filepath = ConfigurationManager.AppSettings["FilePath"].ToString();
                //string filepath = CSystems.FilePath;
                View_MemberResultAttachFileCollection_Base r_attachFile = new View_MemberResultAttachFileCollection_Base(CSystems.ProcessID);
                string whereSql = $"caseid={caseID} AND applicantID={applicantID} AND IsImage=1";
                var rows = r_attachFile.GetAsArray(new List<SqlParameter>(), whereSql, "");
                r_attachFile.Dispose();
                if (rows.Length > 0)
                {
                    List<ProjectResultAttachfile> listResultAttachfiles = new List<ProjectResultAttachfile>();
                    foreach (var i in rows)
                    {
                        listResultAttachfiles.Add(new ProjectResultAttachfile { 
                            CaseID = i.CaseID, 
                            ApplicantID = i.ApplicantID, 
                            AttachFileID = i.AttachFileID, 
                            LableFile = i.LableFile, 
                            Description = i.Description, 
                            FileName = i.FileName, 
                            FileType = i.FileType,
                            IsImage = i.IsImage,
                            //Path = String.IsNullOrEmpty(filepath + $"/transaction/{i.CaseID}/{i.ApplicantID}/{i.FileName}") ? filepath + $"/transaction/{i.CaseID}/{i.ApplicantID}/{i.FileName}" : $"/assets/images/img-not-available.png",
                            Path = System.IO.File.Exists(HttpContext.Server.MapPath($"/filesupload/transaction/{i.CaseID}/{i.ApplicantID}/{i.FileName}")) ? $"/filesupload/transaction/{i.CaseID}/{i.ApplicantID}/{i.FileName}" : $"/assets/images/img-not-available.png",
                            ModifiedDateStr = JFS.Megazy.MilkyWaySolution.Engine.Helpers.Utility.ConvertDateToThaiString(i.ModifiedDate) 
                        });
                    }
                    res.Status = true;
                    res.Data = listResultAttachfiles;
                }
            }
            catch (Exception ex)
            {
                DalBase.ExceptEngine.ThrowException(CSystems.ProcessID, ex);
            }
            return Json(res, JsonRequestBehavior.AllowGet);
        }
