        public JsonResult SaveResultAttachImage(string base64Img, MemberResultAttachFileData imageData)
        {
            ResponseResult res = new ResponseResult();
            DalBase dal = new DalBase();
            string path = "";
            try
            {
                path = HttpContext.Server.MapPath($"/filesupload/transaction/{imageData.CaseID}/{imageData.ApplicantID}/");
                //string filepath = ConfigurationManager.AppSettings["FilePath"].ToString();
                //path = filepath + $"/transaction/{imageData.CaseID}/{imageData.ApplicantID}/";
                UploadFileCaseService service = new UploadFileCaseService(imageData.CaseID, imageData.ApplicantID);
                string fileName = "",
                    fileType = "";
                if (!Directory.Exists(path))
                {
                    Directory.CreateDirectory(path);
                }
                fileName = service.SaveResultAttachFileImage(base64Img, path);
                fileType = service.FileType(base64Img);
                fileName = fileName + "." + fileType;
                path = path + fileName + "." + fileType;

                dal.DbBeginTransaction(CSystems.ProcessID);
                int attachFileID = imageData.AttachFileID;
                if (!string.IsNullOrWhiteSpace(fileName))
                {
                    //INSERT AttachFile 
                    AttachFileCollection_Base attachFile = new AttachFileCollection_Base(CSystems.ProcessID);
                    AttachFileRow fileRow = attachFile.GetByPrimaryKey(imageData.AttachFileID);
                    if (fileRow != null)
                    {
                        fileRow.FileName = fileName;
                        fileRow.FileType = "." + fileType.ToUpper();
                        fileRow.ModifiedDate = dal.GetSqlNow(CSystems.ProcessID);
                        fileRow.SortOrder = 1;
                        attachFile.UpdateOnlyPlainText(fileRow);
                    }
                    else
                    {
                        fileRow = new AttachFileRow
                        {
                            FileName = fileName,
                            FileType = "." + fileType.ToUpper(),
                            ModifiedDate = dal.GetSqlNow(CSystems.ProcessID),
                            SortOrder = 1
                        };
                        attachFileID = attachFile.InsertOnlyPlainText(fileRow);
                        fileRow.AttachFileID = attachFileID;
                    }
                    attachFile.Dispose();
                }
                if (attachFileID != 0)
                {
                    MemberResultAttachFileCollection_Base attachFile = new MemberResultAttachFileCollection_Base(CSystems.ProcessID);
                    var attachRow = attachFile.GetByPrimaryKey(imageData.CaseID,imageData.ApplicantID, attachFileID);
                    if (attachRow != null)
                    {
                        attachRow.CaseID = imageData.CaseID;
                        attachRow.ApplicantID = imageData.ApplicantID;
                        attachRow.AttachFileID = imageData.AttachFileID;
                        attachRow.LableFile = imageData.LableFile;
                        attachRow.Description = imageData.Description;
                        attachRow.IsImage = true;
                        attachRow.ModifiedDate = dal.GetSqlNow(CSystems.ProcessID);
                        attachFile.UpdateOnlyPlainText(attachRow);
                    }
                    else
                    {
                        attachFile.InsertOnlyPlainText(new MemberResultAttachFileRow
                        {
                            CaseID = imageData.CaseID,
                            ApplicantID = imageData.ApplicantID,
                            AttachFileID = attachFileID,
                            LableFile = imageData.LableFile,
                            Description = imageData.Description,
                            IsImage = true,
                            ModifiedDate = dal.GetSqlNow(CSystems.ProcessID)

                        });
                    }
                    attachFile.Dispose();

                    res.Status = true;
                    if (res.Status)
                    {

                        SqlParameter parameter = new SqlParameter();
                        List<SqlParameter> listParameter = new List<SqlParameter>();
                        parameter = new SqlParameter("@AttachFileID", System.Data.SqlDbType.Int) { Value = attachFileID };
                        listParameter.Add(parameter);
                        View_MemberResultAttachFileCollection_Base view_caseAttachFile = new View_MemberResultAttachFileCollection_Base(CSystems.ProcessID);
                        var row = view_caseAttachFile.GetRow(listParameter, $"AttachFileID = @AttachFileID");
                        view_caseAttachFile.Dispose();
                        Engine.DataRepository.ProjectResultAttachfile imageInfo = new Engine.DataRepository.ProjectResultAttachfile
                        {
                            Path = $"/filesupload/transaction/{row.CaseID}/{row.ApplicantID}/{row.FileName}",
                            LableFile = row.LableFile,
                            Description = row.Description,
                            FileName = row.FileName,
                            FileType = row.FileType,
                            CaseID = row.CaseID,
                            AttachFileID = row.AttachFileID,
                            ApplicantID = row.ApplicantID,
                            ModifiedDateStr = JFS.Megazy.MilkyWaySolution.Engine.Helpers.Utility.ConvertDateToThaiString(row.ModifiedDate)
                        };
                        res.Data = imageInfo;
                    }

                }

                dal.DbCommit(CSystems.ProcessID);
            }
            catch (Exception ex)
            {
                if (!Directory.Exists(path))
                {
                    Directory.Delete(path);
                }
                dal.DbRollBack(CSystems.ProcessID);
                DalBase.ExceptEngine.ThrowException(CSystems.ProcessID, ex);
            }

            return Json(res, JsonRequestBehavior.AllowGet);
        }
        [HttpPost]
        public JsonResult DeleteResultAttachFile(int id)
        {
            ResponseResult res = new ResponseResult();
            DalBase dal = new DalBase();
            try
            {
                View_MemberResultAttachFileCollection_Base v_obj = new View_MemberResultAttachFileCollection_Base(CSystems.ProcessID);
                List<SqlParameter> sqlParameters = new List<SqlParameter>();
                sqlParameters.Add(new SqlParameter("@attachfileid", System.Data.SqlDbType.VarChar) { Value = id });
                string wheresql = "AttachfileID = @attachfileid";
                var row = v_obj.GetRow(sqlParameters, wheresql);
                v_obj.Dispose();

                dal.DbBeginTransaction(CSystems.ProcessID);
                if (row != null)
                {
                    MemberResultAttachFileCollection_Base mematt = new MemberResultAttachFileCollection_Base(CSystems.ProcessID);
                    mematt.DeleteByAttachFileID(row.AttachFileID);
                    mematt.Dispose();

                    AttachFileCollection_Base obj = new AttachFileCollection_Base(CSystems.ProcessID);
                    obj.DeleteByPrimaryKey(row.AttachFileID);
                    obj.Dispose();

                    string filepath = $"/filesupload/transaction/{row.CaseID}/{row.ApplicantID}/{row.FileName}";
                    var path = HttpContext.Server.MapPath(filepath);
                    //string filepath = ConfigurationManager.AppSettings["FilePath"].ToString();
                    //var path = filepath + $"/transaction/{row.CaseID}/{row.ApplicantID}/{row.FileName}";
                    if (System.IO.File.Exists(path))
                    {
                        System.IO.File.Delete(path);
                    }
                    dal.DbCommit(CSystems.ProcessID);
                    res.Status = true;
                }

            }
            catch (Exception ex)
            {
                dal.DbRollBack(CSystems.ProcessID);
                DalBase.ExceptEngine.ThrowException(CSystems.ProcessID, ex);
            }
            return Json(res, JsonRequestBehavior.AllowGet);
        }
        [HttpPost]
        public JsonResult DeleteResultAttachVideo(int metaID, int caseID)
        {
            ResponseResult res = new ResponseResult();
            DalBase dal = new DalBase();
            try
            {
                CaseProjectMetaCollection_Base v_obj = new CaseProjectMetaCollection_Base(CSystems.ProcessID);
                List<SqlParameter> sqlParameters = new List<SqlParameter>();
                sqlParameters.Add(new SqlParameter("@metaID", System.Data.SqlDbType.Int) { Value = metaID });
                sqlParameters.Add(new SqlParameter("@caseID", System.Data.SqlDbType.Int) { Value = caseID });
                string wheresql = "caseID=@caseID AND metaID=@metaID";
                var row = v_obj.GetRow(sqlParameters, wheresql);
                v_obj.Dispose();

                dal.DbBeginTransaction(CSystems.ProcessID);
                if (row != null)
                {
                    CaseProjectMetaCollection_Base mematt = new CaseProjectMetaCollection_Base(CSystems.ProcessID);
                    mematt.DeleteByPrimaryKey(row.MetaID,row.CaseID);
                    mematt.Dispose();

                    dal.DbCommit(CSystems.ProcessID);
                    res.Status = true;
                }

            }
            catch (Exception ex)
            {
                dal.DbRollBack(CSystems.ProcessID);
                DalBase.ExceptEngine.ThrowException(CSystems.ProcessID, ex);
            }
            return Json(res, JsonRequestBehavior.AllowGet);
        }


